(24, 24, '{store_name} - Affiliate Program', '&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;Thank you for joining the {store_name} Affiliate Program!&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;Your account must be approved before you can login. Once approved you can log in by using your e-mail address and password by visiting our website or at the following URL:&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;{account_href}&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;Upon logging in, you will be able to generate tracking codes, track commission payments and edit your account information.&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;Thanks,&lt;/p&gt;&lt;p style=&quot;line-height: 17.142858505249px;&quot;&gt;{store_name}&lt;/p&gt;', NULL, NULL, NULL, NULL, NULL, 1, 1),
