(46, 32, 'Possible Fraud', '&lt;p&gt;Hello,&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;/p&gt;\r\n&lt;p&gt;We suspect possible fraud, so your purchase was not authorized.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Please contact us through the site.&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Best regards,&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Sua Compra Online&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;http://dev.suacompraonline.com.br/image/data/logo-1.png&quot;&gt;&lt;/p&gt;', 0, '', NULL, NULL, NULL, 1, 1),
(47, 32, 'Possível Fraude', '&lt;p&gt;Olá,&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nós suspeitamos de uma possível fraude, portanto sua compra não foi autorizada.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Favor entrar em contato conosco pelo site.&amp;nbsp;&lt;br&gt;&lt;br&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Atenciosamente,&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Sua Compra Online&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;http://dev.suacompraonline.com.br/image/data/logo-1.png&quot;&gt;&lt;/p&gt;', 0, '', NULL, NULL, NULL, 1, 2),
(48, 29, 'User {username} logged in on {store_name} admin panel ', 'Hello,&lt;br&gt;&lt;br&gt;\r\nWe would like to notify you that user &lt;strong&gt;{username}&lt;/strong&gt; has just logged in to the admin panel of your store, &lt;strong&gt;{store_name}&lt;/strong&gt;, using IP address &lt;strong&gt;{ip_address}&lt;/strong&gt;.&lt;br&gt;&lt;br&gt;\r\nIf this is expected you need to do nothing about it. If you suspect a hacking attempt, please log in to your store\'s admin panel immediately and change your password at once.&lt;br&gt;&lt;br&gt;\r\nBest Regards,&lt;br&gt;&lt;br&gt;\r\nThe {store_name} team&lt;br&gt;&lt;br&gt;', 0, '', NULL, NULL, NULL, 1, 1),
(49, 29, 'O usuário {username} fez login no painel administrador {store_name}', '&lt;p&gt;Olá,&lt;br&gt;&lt;br&gt; &lt;/p&gt;&lt;p&gt;Nós gostaríamos de notificar que o usuário &lt;strong&gt;{username}&lt;/strong&gt; acaba de logar no painel administrativo de sua loja,&lt;strong&gt;{store_name}&lt;/strong&gt;, usando&amp;nbsp;o endereço de&amp;nbsp;IP &lt;strong&gt;{ip_address}&lt;/strong&gt;.&lt;br&gt;&lt;br&gt; Se isso era esperado, você não precisa fazer nada sobre isso. Caso você suspeite de um ataque hacker, por favor entre em seu painel administrativo e mude sua senha imediatamente.&lt;br&gt; &lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Atenciosamente ,&lt;/p&gt;&lt;p&gt;Sua Compra Online&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;img style=&quot;width: 196.1px; height: 65.36px;&quot; src=&quot;http://dev.suacompraonline.com.br/image/data/2 (1) - Copia.png&quot;&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;i&gt;&lt;/i&gt;&lt;u&gt;&lt;/u&gt;&lt;sub&gt;&lt;/sub&gt;&lt;sup&gt;&lt;/sup&gt;&lt;strike&gt;&lt;/strike&gt;&lt;br&gt;&lt;/p&gt;', 0, '', NULL, NULL, NULL, 1, 2),
