(54, 19, 'You have been sent a gift voucher from {store_name}', '&lt;p&gt;Dear {name}&lt;/p&gt;&lt;p&gt;Congratulations, You have received a Gift Certificate worth {amount}.&lt;/p&gt;&lt;p&gt;This Gift Certificate has been sent to you by {recip_name},With a message saying {message}&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;To redeem this Gift Certificate, write down the redemption code which is {code} then click on the the link below and purchase the product you wish to use this gift voucher on. You can enter the gift voucher code on the shopping cart page before you click checkout.&lt;br&gt;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;Please reply to this e-mail if you have any questions.&lt;br&gt;&lt;/p&gt;', 0, '', NULL, NULL, NULL, 1, 1),
