INSERT INTO `hf7_help` (`help_id`, `language_id`, `question`, `answer`, `category_id`, `sort_order`) VALUES
(2, 1, 'Onde vocês entregam?', 'Estamos em expansão para atender toda Curitiba. Para saber se entregamos em sua região, vá a nossa página inicial, coloque seu CEP e verifique se já atendemos sua região. Caso não estejamos atendendo ainda a sua área, entre em contato conosco e avisaremos quando expandirmos para sua região.', 6, 0),
(2, 2, 'Onde vocês entregam?', 'Estamos em expansão para atender toda Curitiba. Para saber se entregamos em sua região, vá a nossa página inicial, coloque seu CEP e verifique se já atendemos sua região. Caso não estejamos atendendo ainda a sua área, entre em contato conosco e avisaremos quando expandirmos para sua região.', 6, 0),
(8, 1, 'Escolhi um produto e caso ele não esteja disponível não quero outro, como assinalar isso?', 'No seu carrinho, ao lado de cada produto, existe um botão onde você pode selecionar se gostaria ou não que o produto seja substituído caso não esteja disponível no supermercado escolhido.', 7, 0),
(8, 2, 'Escolhi um produto e caso ele não esteja disponível não quero outro, como assinalar isso?', 'No seu carrinho, ao lado de cada produto, existe um botão onde você pode selecionar se gostaria ou não que o produto seja substituído caso não esteja disponível no supermercado escolhido.', 7, 0),
(10, 1, 'Como são os horários de funcionamento da Sua Compra Online?', 'Nossa janela de entregas inicia às 10h00 da manhã e vai até as 10h00 da noite, no entretanto dependemos também do horário de funcionamento do mercado de sua região. Finais de semana e feriados terão horários especiais que podem variar de mercado a mercado. Você poderá verificar as janelas de entrega disponíveis na finalização da compra, podendo agendar sua entrega com até 3 dias de antecedência.\r\nTemos ainda a Entrega Express, esse serviço garante agilidade no seu atendimento e garante que sua compra será entregue em até 2 horas.\r\n', 2, 1),
(10, 2, 'Como são os horários de funcionamento da Sua Compra Online?', 'Nossa janela de entregas inicia às 10h00 da manhã e vai até as 10h00 da noite, no entretanto dependemos também do horário de funcionamento do mercado de sua região. Finais de semana e feriados terão horários especiais que podem variar de mercado a mercado. Você poderá verificar as janelas de entrega disponíveis na finalização da compra, podendo agendar sua entrega com até 3 dias de antecedência.\r\nTemos ainda a Entrega Express, esse serviço garante agilidade no seu atendimento e garante que sua compra será entregue em até 2 horas.\r\n', 2, 1),
(11, 1, 'Quais os mercados que vocês entregam?', 'Os mercados variam de região a região, para verificar em quais os mercados que trabalhamos em sua região, vá a nossa pagina inicial, coloque seu CEP e se sua região for atendida pelo nosso serviço aparecerão os mercados disponíveis para escolha.', 6, 2),
(11, 2, 'Quais os mercados que vocês entregam?', 'Os mercados variam de região a região, para verificar em quais os mercados que trabalhamos em sua região, vá a nossa pagina inicial, coloque seu CEP e se sua região for atendida pelo nosso serviço aparecerão os mercados disponíveis para escolha.', 6, 2),
(12, 1, 'Como faço minha conta?', 'Para realizar sua conta clique aqui ou realize seu cadastro na finalização do seu carrinho. É fácil e seguro, precisamos apenas de algumas informações. Consulte nosso Termo de Compromisso e Politica de Privacidade. ', 5, 0),
(12, 2, 'Como faço minha conta?', 'Para realizar sua conta clique aqui ou realize seu cadastro na finalização do seu carrinho. É fácil e seguro, precisamos apenas de algumas informações. Consulte nosso Termo de Compromisso e Politica de Privacidade. ', 5, 0),
(13, 1, 'Quanto custa a entrega?', 'A entrega tem valor fixo. Para a agendada R$15,90 e para a Entrega Express R$17,90.', 4, 0),
(13, 2, 'Quanto custa a entrega?', 'A entrega tem valor fixo. Para a agendada R$15,90 e para a Entrega Express R$17,90.', 4, 0),
(14, 1, 'Como são os itens são precificados?', 'Os preços são válidos apenas para compra online e podem ser alterados a qualquer momento. Os valores podem variar dos da loja física e podem existir promoções especiais para o meio online.', 4, 0),
(14, 2, 'Como são os itens são precificados?', 'Os preços são válidos apenas para compra online e podem ser alterados a qualquer momento. Os valores podem variar dos da loja física e podem existir promoções especiais para o meio online.', 4, 0),
(15, 1, 'O preço varia de supermercado para supermercado? ', 'Sim, os valores variam de supermercado para supermercado dentro da plataforma.', 4, 0),
(15, 2, 'O preço varia de supermercado para supermercado? ', 'Sim, os valores variam de supermercado para supermercado dentro da plataforma.', 4, 0),
(16, 1, 'Quanto é a compra mínima?', 'O valor mínimo da compra é de R$50,00.', 4, 0),
(16, 2, 'Quanto é a compra mínima?', 'O valor mínimo da compra é de R$50,00.', 4, 0),
(17, 1, 'Como posso pagar a compra?', 'Atualmente trabalhamos apenas com cartão de crédito das seguintes bandeiras:  \r\nAmerican Express, Diners Club, Elo, Master Card e Visa.\r\n', 4, 0),
(17, 2, 'Como posso pagar a compra?', 'Atualmente trabalhamos apenas com cartão de crédito das seguintes bandeiras:  \r\nAmerican Express, Diners Club, Elo, Master Card e Visa.\r\n', 4, 0),
(18, 1, 'O valor total que aparece no carrinho é o valor final da compra? ', 'Não, realizamos um deposito de segurança em seu cartão como fazem hotéis, e apenas quando a compra é finalizada com o código que você recebe em seu celular via SMS o valor final é debitado em seu cartão. Isso acontece pois existem variações no valor final devido a produtos que podem não estar disponíveis e possíveis substituições.', 4, 0),
(18, 2, 'O valor total que aparece no carrinho é o valor final da compra? ', 'Não, realizamos um deposito de segurança em seu cartão como fazem hotéis, e apenas quando a compra é finalizada com o código que você recebe em seu celular via SMS o valor final é debitado em seu cartão. Isso acontece pois existem variações no valor final devido a produtos que podem não estar disponíveis e possíveis substituições.', 4, 0),
(19, 1, 'O que acontece se eu não puder receber a compra na hora que agendei?', 'Você poderá colocar no campo observação quem será o receptor da sua compra, e deverá repassar o código da compra enviado no seu celular para esse receptor, assim ele mesmo poderá confirmar o recebimento. \r\nCaso o receptor não esteja com posse do código do pedido ou não haja ninguém para receber a compra, a mesma será levada ao supermercado de onde poderá ser retirada em até 3 horas. Neste caso o valor total da compra e entrega será debitado e será taxado o valor de multa no valor de mais uma entrega. \r\nCaso o receptor não esteja com posse do código do pedido ou não haja ninguém para receber a compra, a mesma será levada ao supermercado de onde poderá ser retirada em até 3 horas. Neste caso o valor total da compra e entrega será debitado e será taxado o valor de multa no valor de mais uma entrega. ', 6, 0),
(19, 2, 'O que acontece se eu não puder receber a compra na hora que agendei?', 'Você poderá colocar no campo observação quem será o receptor da sua compra, e deverá repassar o código da compra enviado no seu celular para esse receptor, assim ele mesmo poderá confirmar o recebimento. \r\nCaso o receptor não esteja com posse do código do pedido ou não haja ninguém para receber a compra, a mesma será levada ao supermercado de onde poderá ser retirada em até 3 horas. Neste caso o valor total da compra e entrega será debitado e será taxado o valor de multa no valor de mais uma entrega. \r\nCaso o receptor não esteja com posse do código do pedido ou não haja ninguém para receber a compra, a mesma será levada ao supermercado de onde poderá ser retirada em até 3 horas. Neste caso o valor total da compra e entrega será debitado e será taxado o valor de multa no valor de mais uma entrega. ', 6, 0),
(20, 1, 'Como eu sei o status da minha compra?', 'Você receberá a atualização do status da sua compra no seu celular cadastrado via sms, e poderá consultar o status no site ou aplicativo entrando no seu cadastro. ', 7, 0),
(20, 2, 'Como eu sei o status da minha compra?', 'Você receberá a atualização do status da sua compra no seu celular cadastrado via sms, e poderá consultar o status no site ou aplicativo entrando no seu cadastro. ', 7, 0),
(21, 1, 'O que acontece quando o produto que comprei não tem no supermercado?', 'No seu carrinho é possível selecionar se o produto escolhido é substituível ou não.  Se um produto solicitado não estiver disponível no supermercado o shopper poderá levar um similar (caso o produto seja substituível) ou apenas não levar (caso o produto não possa ser substituído por um similar), é você quem escolhe.  O valor a ser cobrado será dos itens entregues, podendo ser a maior ou a menor do que o previsto no checkout.', 7, 0),
(21, 2, 'O que acontece quando o produto que comprei não tem no supermercado?', 'No seu carrinho é possível selecionar se o produto escolhido é substituível ou não.  Se um produto solicitado não estiver disponível no supermercado o shopper poderá levar um similar (caso o produto seja substituível) ou apenas não levar (caso o produto não possa ser substituído por um similar), é você quem escolhe.  O valor a ser cobrado será dos itens entregues, podendo ser a maior ou a menor do que o previsto no checkout.', 7, 0),
(22, 1, 'Como eu informo sobre algum erro na plataforma?', 'Agradecemos muito pelo interesse em melhorar a nossa plataforma, sinta-se à vontade para nos comunicar de qualquer problema, experiência ou erro no nosso fale conosco ou chat.', 1, 0),
(22, 2, 'Como eu informo sobre algum erro na plataforma?', 'Agradecemos muito pelo interesse em melhorar a nossa plataforma, sinta-se à vontade para nos comunicar de qualquer problema, experiência ou erro no nosso fale conosco ou chat.', 1, 0),
(23, 1, 'Como faço para ser um shopper da Sua Compra Online?', 'Para ser um shopper, clique no botão superior esquerdo na nossa página inicial “Seja uma shopper” e preencha nosso cadastro que entraremos em contato.', 2, 0),
(23, 2, 'Como faço para ser um shopper da Sua Compra Online?', 'Para ser um shopper, clique no botão superior esquerdo na nossa página inicial “Seja uma shopper” e preencha nosso cadastro que entraremos em contato.', 2, 0),
(24, 1, 'O que é um shopper?', 'Shopper é como chamamos nossos compradores profissionais, pessoas selecionadas e treinadas para realizar uma compra com qualidade e agilidade. Quando você realiza sua compra na nossa plataforma acionamos os shoppers de sua região, um deles aceita o pedido, vai até o supermercado que você escolheu e faz sua compra do jeitinho que você faria. Escolhe as frutas, verduras, todos os itens tais quais você solicitou, por isso sinta-se à vontade no final da compra para colocar as especificações dos itens que gostaria de receber, por exemplo: pão branquinho ou banana madura, ficaremos felizes em te atender da melhor forma possível. \r\nApós a compra eles mesmos vão até a sua residência ou outro endereço escolhido e realizam a entrega. \r\n', 2, 0),
(24, 2, 'O que é um shopper?', 'Shopper é como chamamos nossos compradores profissionais, pessoas selecionadas e treinadas para realizar uma compra com qualidade e agilidade. Quando você realiza sua compra na nossa plataforma acionamos os shoppers de sua região, um deles aceita o pedido, vai até o supermercado que você escolheu e faz sua compra do jeitinho que você faria. Escolhe as frutas, verduras, todos os itens tais quais você solicitou, por isso sinta-se à vontade no final da compra para colocar as especificações dos itens que gostaria de receber, por exemplo: pão branquinho ou banana madura, ficaremos felizes em te atender da melhor forma possível. \r\nApós a compra eles mesmos vão até a sua residência ou outro endereço escolhido e realizam a entrega. \r\n', 2, 0);
