INSERT INTO `hf7_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(3, 1, 'Política de Privacidade', '            DA POLÍTICA DE PRIVACIDADE:\r\n\r\nEsta Política de Privacidade (&quot;Política&quot;) se aplica ao site do Sua Compra Online (www.suacompraonline.com.br) (&quot;Site&quot;) e tem como finalidade esclarecer ao usuário do Site (&quot;Usuário&quot;) como as informações por ele cadastradas e enviadas/postadas serão protegidas, usadas, divulgadas, transferidas e armazenadas.\r\nÉ compromisso da Sua Compra Online demonstrar total respeito por sua privacidade, garantindo a proteção dos seus dados pessoas e do sigilo de todas as informações fornecidas.\r\nEsta Política de Privacidade e o Termo de Uso do Site devem ser lidos atentamente pelo Usuário antes de iniciar a navegação pelo Site.\r\nA política de privacidade da Sua Compra Online foi elaborada para garantir a segurança, proteção, privacidade e sigilo de seus dados e está de acordo com as diretrizes previstas na Lei nº 12.965/2014.\r\nAs informações disponibilizadas no Site estão sujeitas a alterações sem prévio aviso ou autorização. As informações fornecidas no Site pela Sua Compra Online serão exclusivamente divulgadas com propósito informativo.\r\nA Sua Compra Online somente divulgará as informações pessoais do Usuário, se necessário, em razão de lei e/ou ordem judicial ou de autoridades governamentais/administrativas.\r\nA Sua Compra Online toma medidas preventivas adequadas para proteger as informações pessoais dos Usuários contra perda, roubo, uso indevido, bem como contra acesso não autorizado, divulgação, alteração e destruição. Não obstante, o Usuário deve estar ciente de que, em relação à internet, não existem medidas de segurança totalmente infalíveis.\r\n\r\nDO CADASTRO:\r\n\r\nPara que possamos disponibilizar o serviço corretamente, visando a segurança de ambas as partes, alguns dados são de fornecimento obrigatório. Garantimos, portanto, o sigilo de tais dados. No caso de dados de cartão de crédito, estes serão protegidos por criptografia.\r\nÉ de responsabilidade pessoal do usuário a atualização de seus dados, bem como o correto preenchimento, sendo expressamente proibida a transferência ou empréstimo da senha de acesso ao site e serviços oferecidos. Durante a navegação do Usuário no Site, são arquivadas estatísticas sobre as páginas mais visitadas e o tempo gasto em cada sessão, visando ajudar o Usuário a encontrar rapidamente o que precisa. Tais informações genéricas podem ser utilizadas ainda para divulgar, por exemplo, os conteúdos mais acessados no Site, ou para informar a um anunciante que um determinado número de pessoas se cadastrou no Site, sempre preservando a intimidade e os dados pessoais dos Usuários.\r\nQuanto às informações pessoais dos Usuários, a Sua Compra Online não as fornece a terceiros, sejam eles anunciantes ou parceiros, sob hipótese nenhuma. Tais informações podem, porém, ser transformadas em estatísticas genéricas, as quais por sua vez podem ser compartilhadas com parceiros.\r\nSempre que forem realizadas pesquisas ou promoções em conjunto com algum anunciante, será informado antecipadamente que as respostas serão compartilhadas com essa empresa.\r\nO e-mail do Usuário somente será utilizado para divulgar produtos, novidades, promoções e concursos, e apenas quando essa utilização tiver sido expressamente autorizada pelo Usuário no momento do seu cadastro.\r\nA qualquer momento, o Usuário poderá cancelar seu cadastro, bastando seguir as orientações apresentadas no próprio Site.\r\n\r\nDOS LINKS EXTERNOS:\r\n\r\nO Site poderá dar acesso a links para outros sites externos cujos conteúdos e políticas de privacidade não são de responsabilidade da Sua Compra Online. Assim, recomenda-se que, ao serem redirecionados para sites externos, os Usuários consultem sempre as respectivas políticas de privacidade antes de fornecerem seus dados ou informações.\r\n\r\nDA UTILIZAÇÃO DOS COOKIES:\r\n\r\nAo acessar o Site, a Sua Compra Online informará ao Usuário da utilização de cookies durante a navegação no Site. Cookies correspondem a pequenos arquivos de texto, que armazenam preferências do usuário na utilização de determinados sites na internet, sendo capaz de determinar conteúdos, serviços e até mesmo que tipo de suporte são apropriados para cada usuário e computador, aprimorando a experiência de navegação do Usuário e tornando-a mais rápida. A Sua Compra Online tem como objetivo oferecer serviços personalizados a seus Usuários e de maneira alguma possuí a intenção de invadir a privacidade e intimidade dos mesmos durante sua visita.\r\nO Usuário pode configurar o seu navegador de forma a bloquear a coleta de alguns tipos de informações, tais como cookies. Todavia, caso essa configuração seja implementada, é importante destacar que existe a possibilidade de que alguns recursos oferecidos pelo Portal deixem de funcionar corretamente.\r\n\r\nDOS DIREITOS AUTORAIS E PROPRIEDADE INTELECTUAL:\r\n\r\nSalvo disposição em contrário, todo o conteúdo das páginas do Site, tais como informações, materiais, instrumentos, organização da página, gráficos e desenhos, bem como as mensagens e/ou comentários enviados pelos Usuários pertencem a Sua Compra Online ou a terceiros que cederam seu direito de uso.\r\nO conteúdo do Site não poderá ser copiado, reproduzido, distribuído, re-publicado, apresentado, anunciado ou transmitido de nenhuma maneira ou por nenhum meio, incluindo, mas não limitado a, meios eletrônicos, mecânicos, de fotocópia, de gravação ou de qualquer outra índole, sem a permissão prévia por escrito da Sua Compra Online ou do titular dos direitos autorais.\r\nNada no Site deverá ser interpretado como concessão, tácita, por exclusão ou de nenhuma outra maneira, de nenhuma licença ou de direito de uso de qualquer marca apresentada no Site sem a permissão por escrito do titular dos direitos da marca. O nome Sua Compra Online ou qualquer de suas marcas ou logotipos, não podem ser usados de maneira alguma, incluindo anúncios, &quot;link&quot; para sites, ou ou publicidade relacionados à distribuição do material do Site, sem permissão prévia por escrito.\r\n\r\nDAS LEIS E FORO:\r\n\r\nEsta Política será interpretada de acordo com a legislação da República Federativa do Brasil. Caso haja qualquer conflito decorrente da utilização do Site, a lei brasileira será aplicada e o foro da Comarca de Curitiba será o foro competente para dirimir o conflito.\r\n\r\nDA ACEITAÇÃO E ATUALIZAÇÃO DA POLÍTICA:\r\n\r\nAo fornecer informações pessoais, postar mensagens/comentários ou navegar no Site, o Usuário estará automaticamente concordando com a coleta, uso, armazenamento e tratamento dos seus dados pessoais, nos termos dessa Política de Privacidade.\r\nAs informações contidas nesta Política podem ser alteradas a qualquer momento, sem aviso prévio, sendo importante que o Usuário verifique sempre a política de privacidade.\r\n\r\n ', 'Política de Privacidade', '', ''),
(3, 2, 'Política de Privacidade', '            DA POLÍTICA DE PRIVACIDADE:\r\n\r\nEsta Política de Privacidade (&quot;Política&quot;) se aplica ao site do Sua Compra Online (www.suacompraonline.com.br) (&quot;Site&quot;) e tem como finalidade esclarecer ao usuário do Site (&quot;Usuário&quot;) como as informações por ele cadastradas e enviadas/postadas serão protegidas, usadas, divulgadas, transferidas e armazenadas.\r\nÉ compromisso da Sua Compra Online demonstrar total respeito por sua privacidade, garantindo a proteção dos seus dados pessoas e do sigilo de todas as informações fornecidas.\r\nEsta Política de Privacidade e o Termo de Uso do Site devem ser lidos atentamente pelo Usuário antes de iniciar a navegação pelo Site.\r\nA política de privacidade da Sua Compra Online foi elaborada para garantir a segurança, proteção, privacidade e sigilo de seus dados e está de acordo com as diretrizes previstas na Lei nº 12.965/2014.\r\nAs informações disponibilizadas no Site estão sujeitas a alterações sem prévio aviso ou autorização. As informações fornecidas no Site pela Sua Compra Online serão exclusivamente divulgadas com propósito informativo.\r\nA Sua Compra Online somente divulgará as informações pessoais do Usuário, se necessário, em razão de lei e/ou ordem judicial ou de autoridades governamentais/administrativas.\r\nA Sua Compra Online toma medidas preventivas adequadas para proteger as informações pessoais dos Usuários contra perda, roubo, uso indevido, bem como contra acesso não autorizado, divulgação, alteração e destruição. Não obstante, o Usuário deve estar ciente de que, em relação à internet, não existem medidas de segurança totalmente infalíveis.\r\n\r\nDO CADASTRO:\r\n\r\nPara que possamos disponibilizar o serviço corretamente, visando a segurança de ambas as partes, alguns dados são de fornecimento obrigatório. Garantimos, portanto, o sigilo de tais dados. No caso de dados de cartão de crédito, estes serão protegidos por criptografia.\r\nÉ de responsabilidade pessoal do usuário a atualização de seus dados, bem como o correto preenchimento, sendo expressamente proibida a transferência ou empréstimo da senha de acesso ao site e serviços oferecidos. Durante a navegação do Usuário no Site, são arquivadas estatísticas sobre as páginas mais visitadas e o tempo gasto em cada sessão, visando ajudar o Usuário a encontrar rapidamente o que precisa. Tais informações genéricas podem ser utilizadas ainda para divulgar, por exemplo, os conteúdos mais acessados no Site, ou para informar a um anunciante que um determinado número de pessoas se cadastrou no Site, sempre preservando a intimidade e os dados pessoais dos Usuários.\r\nQuanto às informações pessoais dos Usuários, a Sua Compra Online não as fornece a terceiros, sejam eles anunciantes ou parceiros, sob hipótese nenhuma. Tais informações podem, porém, ser transformadas em estatísticas genéricas, as quais por sua vez podem ser compartilhadas com parceiros.\r\nSempre que forem realizadas pesquisas ou promoções em conjunto com algum anunciante, será informado antecipadamente que as respostas serão compartilhadas com essa empresa.\r\nO e-mail do Usuário somente será utilizado para divulgar produtos, novidades, promoções e concursos, e apenas quando essa utilização tiver sido expressamente autorizada pelo Usuário no momento do seu cadastro.\r\nA qualquer momento, o Usuário poderá cancelar seu cadastro, bastando seguir as orientações apresentadas no próprio Site.\r\n\r\nDOS LINKS EXTERNOS:\r\n\r\nO Site poderá dar acesso a links para outros sites externos cujos conteúdos e políticas de privacidade não são de responsabilidade da Sua Compra Online. Assim, recomenda-se que, ao serem redirecionados para sites externos, os Usuários consultem sempre as respectivas políticas de privacidade antes de fornecerem seus dados ou informações.\r\n\r\nDA UTILIZAÇÃO DOS COOKIES:\r\n\r\nAo acessar o Site, a Sua Compra Online informará ao Usuário da utilização de cookies durante a navegação no Site. Cookies correspondem a pequenos arquivos de texto, que armazenam preferências do usuário na utilização de determinados sites na internet, sendo capaz de determinar conteúdos, serviços e até mesmo que tipo de suporte são apropriados para cada usuário e computador, aprimorando a experiência de navegação do Usuário e tornando-a mais rápida. A Sua Compra Online tem como objetivo oferecer serviços personalizados a seus Usuários e de maneira alguma possuí a intenção de invadir a privacidade e intimidade dos mesmos durante sua visita.\r\nO Usuário pode configurar o seu navegador de forma a bloquear a coleta de alguns tipos de informações, tais como cookies. Todavia, caso essa configuração seja implementada, é importante destacar que existe a possibilidade de que alguns recursos oferecidos pelo Portal deixem de funcionar corretamente.\r\n\r\nDOS DIREITOS AUTORAIS E PROPRIEDADE INTELECTUAL:\r\n\r\nSalvo disposição em contrário, todo o conteúdo das páginas do Site, tais como informações, materiais, instrumentos, organização da página, gráficos e desenhos, bem como as mensagens e/ou comentários enviados pelos Usuários pertencem a Sua Compra Online ou a terceiros que cederam seu direito de uso.\r\nO conteúdo do Site não poderá ser copiado, reproduzido, distribuído, re-publicado, apresentado, anunciado ou transmitido de nenhuma maneira ou por nenhum meio, incluindo, mas não limitado a, meios eletrônicos, mecânicos, de fotocópia, de gravação ou de qualquer outra índole, sem a permissão prévia por escrito da Sua Compra Online ou do titular dos direitos autorais.\r\nNada no Site deverá ser interpretado como concessão, tácita, por exclusão ou de nenhuma outra maneira, de nenhuma licença ou de direito de uso de qualquer marca apresentada no Site sem a permissão por escrito do titular dos direitos da marca. O nome Sua Compra Online ou qualquer de suas marcas ou logotipos, não podem ser usados de maneira alguma, incluindo anúncios, &quot;link&quot; para sites, ou ou publicidade relacionados à distribuição do material do Site, sem permissão prévia por escrito.\r\n\r\nDAS LEIS E FORO:\r\n\r\nEsta Política será interpretada de acordo com a legislação da República Federativa do Brasil. Caso haja qualquer conflito decorrente da utilização do Site, a lei brasileira será aplicada e o foro da Comarca de Curitiba será o foro competente para dirimir o conflito.\r\n\r\nDA ACEITAÇÃO E ATUALIZAÇÃO DA POLÍTICA:\r\n\r\nAo fornecer informações pessoais, postar mensagens/comentários ou navegar no Site, o Usuário estará automaticamente concordando com a coleta, uso, armazenamento e tratamento dos seus dados pessoais, nos termos dessa Política de Privacidade.\r\nAs informações contidas nesta Política podem ser alteradas a qualquer momento, sem aviso prévio, sendo importante que o Usuário verifique sempre a política de privacidade.\r\n\r\n ', '', '', ''),
