quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; Put your ZIP code.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 0px 48px; text-indent: -18pt;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;2-&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;span style=&quot;font: 7pt &amp;quot;Times New Roman&amp;quot;; margin: 0px; font-size-adjust: none; font-stretch: normal;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; Choose a supermarket in your area.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 0px 48px; text-indent: -18pt;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;3-&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;span style=&quot;font: 7pt &amp;quot;Times New Roman&amp;quot;; margin: 0px; font-size-adjust: none; font-stretch: normal;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; Make the purchase by choosing the items you want and let us know if we can exchange for a similar product in case the chosen product is not available in store. &lt;/font&gt;&lt;font&gt;You can still give us specifications on how you like your purchase for example: white bread or ripe bananas.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 0px 48px; text-indent: -18pt;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;4-&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;span style=&quot;font: 7pt &amp;quot;Times New Roman&amp;quot;; margin: 0px; font-size-adjust: none; font-stretch: normal;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; Choose where and when you want to receive.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 0px 48px; text-indent: -18pt;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;5-&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;span style=&quot;font: 7pt &amp;quot;Times New Roman&amp;quot;; margin: 0px; font-size-adjust: none; font-stretch: normal;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; Finish the purchase with your data and paying with your credit card.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 0px 48px; text-indent: -18pt;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;6-&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;span style=&quot;font: 7pt &amp;quot;Times New Roman&amp;quot;; margin: 0px; font-size-adjust: none; font-stretch: normal;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt; One of our professional buyers from your region will be triggered, it will go until the chosen supermarket will make your purchase and deliver it to you.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 11px 48px;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 11px;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;You can make your purchase of the month or buy the items for dinner soon. &lt;/font&gt;&lt;font&gt;More convenience and time for you to do what you enjoy.&lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 11px;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-size: 12pt;&quot;&gt;&lt;font color=&quot;#000000&quot; face=&quot;Calibri&quot;&gt;&lt;font&gt;&lt;font&gt;Your Online Shopping, a new way to do your shopping. &lt;/font&gt;&lt;/font&gt;&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;\r\n', 'Sobre Nós', '', '');
INSERT INTO `hf7_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(5, 1, 'Termos e Condições de Uso', '&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 11px; text-align: justify;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-family: &amp;quot;Tahoma&amp;quot;,sans-serif; font-size: 10pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;line-height:107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;TERMO\r\nE CONDIÇÕES DE USO&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;LEIA COM ATENÇÃO OS\r\nTERMOS E CONDIÇÕES GERAIS DE USO, POIS NELES CONSTAM TODAS AS INFORMAÇÕES\r\nIMPORTANTES SOBRE OS SEUS DIREITOS E OBRIGAÇÕES LEGAIS, INCLUINDO LIMITAÇÕES,\r\nEXCLUSÕES E UM FORO PARA DIRIMIR EVENTUAIS CONFLITOS RELATIVOS AO PRESENTE\r\nCONTRATO.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O presente termo foi desenvolvido de modo que você usuário tenha\r\nconhecimento das condições gerais que devem ser observadas ao utilizar o\r\npresente site. Este documento contém informações legais importantes e\r\nindispensáveis à utilização do presente site, sendo, portanto, obrigatória a\r\nsua leitura e compreensão por parte do Usuário.&lt;span style=&quot;color:red&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;A SUACOMPRAONLINE É UMA\r\nPLATAFORMA ONLINE QUE FUNCIONA COMO INTERMEDIÁRIA COMERCIAL CONECTANDO\r\nPARCEIROS, SHOPPERS E CLIENTES. A SUACOMPRAONLINE NÃO É PARTE DE NENHUM ACORDO\r\nCELEBRADO ENTRE PARCEIROS E CLIENTES, BEM COMO NÃO ATUA COMO SEGURADORA, NÃO\r\nPRESTA SERVIÇO DE COMPRA OU ENTREGA DE PRODUTOS E NÃO POSSUÍ NENHUMA\r\nRESPONSABILIDADE SOBRE A CONDUTA DOS PARCEIROS, CLIENTES OU SHOPPERS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;DEFINIÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SUACOMPRAONLINE:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; de razão\r\nsocial &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SUACOMPRAONLINE\r\nPORTAL E SERVIÇOS DE INTERNET LTDA, também denominada “SITE”, “PORTAL”,\r\n“PLATAFORMA”. É uma plataforma de intermediação comercial que conecta parceiros\r\ne SHOPPERS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;PARCEIROS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são\r\nestabelecimentos comerciais que ofertam seus produtos na plataforma. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SHOPPERS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são compradores\r\ntreinados e cadastrados na plataforma para efetuar a compra e entrega dos\r\nprodutos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;CLIENTES:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são USUÁRIOS\r\ndevidamente cadastrados na plataforma.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;USUÁRIOS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; qualquer pessoa que\r\nesteja navegando na SUACOMPRAONLINE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;TERMO:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; contrato digital que\r\nestabelece as regras de utilização do USUÁRIO na plataforma.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;ACEITAÇÃO:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;AO UTILIZAR O\r\nPRESENTE SITE, VOCÊ USUÁRIO CONCORDA COM TODO OS TERMOS E CONDIÇÕES GERAIS DE\r\nUSO, AINDA QUE NÃO SEJA UM CLIENTE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;No caso de o USUÁRIO não concordar com os termos e condições\r\ndescritos nesse documento, o mesmo não possuí direito de obter informações e não\r\ndeve utilizar este SITE. Lembre-se, ainda, que as disposições contidas nestes\r\nTermos podem ser atualizadas a qualquer tempo e a exclusivo critério da SUACOMPRAONLINE,\r\nsendo de responsabilidade do USUÁRIO verificá-los com frequência.&lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;A aceitação a este TERMO implicará, ainda, a\r\naceitação à Política de Privacidade do PORTAL, que poderá ser consultada&lt;span class=&quot;apple-converted-space&quot; style=&quot;color: rgb(0, 0, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 255, 255);&quot;&gt;&lt;span style=&quot;background: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;a href=&quot;http://dev.suacompraonline.com.br/index.php?path=information/information&amp;amp;information_id=3&quot; target=&quot;_blank&quot;&gt;AQUI.&lt;/a&gt;&lt;span style=&quot;background: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SERVIÇOS PRESTADOS:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A Sua Compra Online não comercializa ou transporta produtos,\r\ntendo como seu objetivo apenas aproximar CLIENTES, supermercados PARCEIROS e SHOPPERS.\r\nSua Compra Online é apenas uma plataforma e agente de cobrança sendo isenta de\r\nqualquer responsabilidade na qualidade do produto a ser entregue. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:\r\n107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;CADASTRO:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Para a correta utilização do SITE, o USUÁRIO, deverá, por\r\nlivre espontânea vontade realizar o cadastro no PORTAL, por meio da internet no\r\npróprio SITE. O Cadastro está condicionado ao fornecimento de dados cadastrais,\r\ninformados em campos específicos como: nome, data de nascimento, endereço, CPF,\r\ne-mail e telefones de contato, a fim de facilitar as compras no PORTAL. O\r\nUSUÁRIO por meio do cadastro manifesta o consentimento livre, expresso e\r\ninformado para a coleta, uso, armazenamento, tratamento e compartilhamento dos\r\ndados, nos termos da POLÍTICA DE PRIVACIDADE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Assim, o USUÁRIO, contrata, ao se cadastrar na plataforma, a\r\nSUACOMPRAONLINE como intermediadora para aproximá-lo a SHOPPERS e supermercados\r\nPARCEIROS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;LIMITAÇÕES DE\r\nRESPONSABILIDADES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;Para\r\nutilizar o PORTAL e realizar a compra de produtos o USUÁRIO deverá ser\r\ncivilmente capaz, nos moldes da legislação civil vigente no Brasil.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;O\r\nUSUÁRIO se compromete a fornecer ao PORTAL apenas dados e informações\r\nverdadeiras garantindo&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; a autenticidade de toda\r\ninformação e dados fornecidos na utilização do PORTAL, se responsabilizando\r\ncivil e criminalmente por qualquer inexatidão que venha a causar prejuízos ao\r\nPORTAL ou terceiros, se obrigando, ainda, a manter seus dados e informações\r\nconstantemente atualizadas, sempre que houver alterações.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O acesso a áreas restritas dentro do SITE somente é permitida\r\na CLIENTES devidamente cadastrados, utilizando login e senha pessoal, sendo\r\ntais áreas consideradas fechadas. Neste sentido, o USUÁRIO fica ciente que se\r\nalguma falha no sistema for encontrada que permita seu acesso a qualquer área\r\nrestrita do PORTAL, ainda que por mera tentativa e erro de acerto de senha,\r\nincidirá tal USUÁRIO em sanções civis e criminais decorrentes de sua conduta.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O CLIENTE assume neste ato integral responsabilidade pela\r\nguarda e pelo sigilo de seu login e senha de acesso, bem como pelo uso indevido\r\nde seu cadastro por terceiros.&lt;span class=&quot;apple-converted-space&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O CLIENTE fica ciente de que, sempre que fundado em indício\r\nde ato ilícito ou descumprimento às regras destes TERMOS, a SUACOMPRAONLINE se\r\nreserva o direito de bloquear o cadastro, suspender temporariamente ou cancelar\r\ndefinitivamente o cadastro do CLIENTE, a qualquer tempo e a seu exclusivo\r\ncritério, sem necessidade de notificação prévia e sem prejuízo de outras\r\nmedidas que entender necessárias e oportunas.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;A\r\nSUACOMPRAONLINE se reserva no direito de não realizar a entrega dos produtos em\r\ncaso de alguma inconsistência no cadastro, sendo opcional a SUACOMPRAONLINE o\r\nestorno financeiro ao CLIENTE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A SUACOMPRAONLINE é apenas um agente de cobrança, unicamente\r\ncom a finalidade de coletar pagamentos, sem que haja prestação de serviços\r\nrelacionados à venda ou transporte de bens. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Ao aceitar a nomeação de agente de cobrança dos supermercados\r\nPARCEIROS e SHOPPERS, a SUACOMPRAONLINE não assume qualquer responsabilidade\r\npor quaisquer atos ou omissões destes, não se tornando solidária na obrigação\r\ncontratada junto a eles.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Ficam responsáveis os SHOPPERS, pela integridade, validade e\r\nseleção dos produtos, bem como a entrega na quantidade correta e no prazo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É de responsabilidade do CLIENTE avaliar o SHOPPER\r\ncorretamente, e conferir a compra no recebimento. Dada confirmação de\r\nrecebimento pelo CLIENTE, isenta-se de responsabilidade qualquer outra parte. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;DEVOLUÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Não haverá devolução de valores, após a aceitação do presente\r\nTERMO. Na hipótese de falha do serviço, serão realizadas análises de cada caso.\r\nEm sendo detectada a falha, poderá ser feita a devolução dos valores pagos,\r\ncabendo ao CLIENTE a comprovação da não utilização do serviço/produto.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Nós da Sua Compra Online priorizamos a entrega e fazemos o\r\npossível para que sua compra seja entregue no horário agendado, no entanto,\r\nimprevistos podem ocorrer, podendo gerar leves atrasos, a Sua Compra Online não\r\nse responsabiliza por atrasos de shoppers. Caso o cliente tenha optado por uma\r\ncompra com entrega express e não for atendido em até 2 horas será cobrado o\r\nvalor da entrega comum. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Caso sinta necessidade de reclamar sobre algum produto ou\r\nsobre o serviço, entre em contato conosco via chat ou fale conosco. Produtos\r\nque necessitem de troca devem ser trocados na loja em que foram comprados.&lt;br&gt;\r\n&lt;br&gt;\r\nNo momento do recebimento é necessário que haja uma pessoa de posse do código\r\nde compra enviado via SMS para o celular cadastrado para acusar o recebimento\r\nda compra. Caso no horário agendado para a entrega não haja ninguém habilitado\r\na receber a compra a mesma será devolvida ao supermercado de onde foi comprada\r\ne lá permanecerá para retirada por 3 horas, não sendo retirada em 3 horas a\r\ncompra será devolvida ao supermercado. Em todos os casos acima será cobrado o\r\nvalor da compra e da entrega, e para casos de não recebimento será aplicada\r\nmulta de igual valor ao da entrega. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;VALORES: &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;Os\r\nvalores dos produtos disponíveis na PLATAFORMA são definidos pelo supermercado\r\nPARCEIRO, sem interferência da SUACOMPRAONLINE. Entretanto, poderão ser\r\nacrescidos taxas e encargos nos valores dos produtos, quando comparadas ao\r\nvalor da loja física. Os valores serão cobrados unicamente por meio da\r\nPLATAFORMA, no momento da aquisição dos produtos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Preços, ofertas e condições exclusivos para internet são\r\nválidos enquanto na plataforma, podendo sofrer alterações sem prévia\r\nnotificação. &lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A SUACOMPRAONLINE não se responsabiliza por eventuais\r\ngorjetas ou gratificações pagas aos SHOPPERS, os quais poderão, mas não\r\ndeverão, ser pagos pelo CLIENTE, a seu critério, sem que haja nenhuma obrigação\r\ngerada pela utilização da PLATAFORMA.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Todo o pagamento sempre será realizado diretamente no SITE,\r\npor meio de cartão de crédito.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;BEBIDAS ALCOÓLICAS:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Proibida a venda de bebidas alcoólicas para menores de idade,\r\nconforme Lei nº8069/90, art. 81, inciso II (Estatuto da Criança e do\r\nAdolescente).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;OPNIÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A Sua Compra Online possuí canais abertos para opinião dos\r\nUSUÁRIOS, sendo estas de extrema importância para que possamos continuar a\r\nmelhorar a cada dia nossos serviços. Todavia, autores de comentário ofensivos\r\npoderão ser responsabilizados civil e criminalmente, por conteúdos publicados\r\nque violem a Lei e ou produzam lesões a direitos de terceiros e ou da empresa SUACOMPRAONLINE.\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É facultativo à SUACOMPRAONLINE a exclusão de comentários,\r\nanúncios, dados e opiniões que sejam caracterizados como contrários a lei, aos\r\nprincípios constitucionais, morais e éticos, bem como os que violem os termos e\r\ncondições.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;MODIFICAÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É direito da SUACOMPRAONLINE realizar modificações no\r\npresente TERMO, visando seu aprimoramento, a melhoria dos serviços prestados ou\r\nrequisições legais que venha a ser necessárias. O novo termo entrará em vigor\r\n10 (dez) dias após sua publicação no site.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;As alterações não vigorarão, porém, em negociações já\r\niniciadas antes de sua publicação, permanecendo nesses casos a redação anterior\r\ncomo vigente. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:\r\n107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;FORO:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Fica eleito o foro da Comarca de Curitiba/PR, para dirimir\r\nquaisquer dúvidas e/ou questões relativas ao presente instrumento com renúncia\r\na qualquer outro, por mais privilegiado que seja.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'Termos e Condições de Uso', '', '');
INSERT INTO `hf7_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(5, 2, 'Termos e Condições de Uso', '&lt;p&gt;\r\n\r\n&lt;br&gt;&lt;/p&gt;&lt;p style=&quot;margin: 0px 0px 11px; text-align: justify;&quot;&gt;&lt;span style=&quot;margin: 0px; line-height: 107%; font-family: &amp;quot;Tahoma&amp;quot;,sans-serif; font-size: 10pt;&quot;&gt;&lt;span style=&quot;margin: 0px;&quot;&gt;&lt;font color=&quot;#000000&quot;&gt;&amp;nbsp;&lt;/font&gt;&lt;/span&gt;&lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:10.0pt;line-height:107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;TERMO\r\nE CONDIÇÕES DE USO&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;LEIA COM ATENÇÃO OS\r\nTERMOS E CONDIÇÕES GERAIS DE USO, POIS NELES CONSTAM TODAS AS INFORMAÇÕES\r\nIMPORTANTES SOBRE OS SEUS DIREITOS E OBRIGAÇÕES LEGAIS, INCLUINDO LIMITAÇÕES,\r\nEXCLUSÕES E UM FORO PARA DIRIMIR EVENTUAIS CONFLITOS RELATIVOS AO PRESENTE\r\nCONTRATO.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O presente termo foi desenvolvido de modo que você usuário tenha\r\nconhecimento das condições gerais que devem ser observadas ao utilizar o\r\npresente site. Este documento contém informações legais importantes e\r\nindispensáveis à utilização do presente site, sendo, portanto, obrigatória a\r\nsua leitura e compreensão por parte do Usuário.&lt;span style=&quot;color:red&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;A SUACOMPRAONLINE É UMA\r\nPLATAFORMA ONLINE QUE FUNCIONA COMO INTERMEDIÁRIA COMERCIAL CONECTANDO\r\nPARCEIROS, SHOPPERS E CLIENTES. A SUACOMPRAONLINE NÃO É PARTE DE NENHUM ACORDO\r\nCELEBRADO ENTRE PARCEIROS E CLIENTES, BEM COMO NÃO ATUA COMO SEGURADORA, NÃO\r\nPRESTA SERVIÇO DE COMPRA OU ENTREGA DE PRODUTOS E NÃO POSSUÍ NENHUMA\r\nRESPONSABILIDADE SOBRE A CONDUTA DOS PARCEIROS, CLIENTES OU SHOPPERS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;DEFINIÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SUACOMPRAONLINE:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; de razão\r\nsocial &lt;/span&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SUACOMPRAONLINE\r\nPORTAL E SERVIÇOS DE INTERNET LTDA, também denominada “SITE”, “PORTAL”,\r\n“PLATAFORMA”. É uma plataforma de intermediação comercial que conecta parceiros\r\ne SHOPPERS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;PARCEIROS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são\r\nestabelecimentos comerciais que ofertam seus produtos na plataforma. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SHOPPERS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são compradores\r\ntreinados e cadastrados na plataforma para efetuar a compra e entrega dos\r\nprodutos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;CLIENTES:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; são USUÁRIOS\r\ndevidamente cadastrados na plataforma.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;USUÁRIOS:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; qualquer pessoa que\r\nesteja navegando na SUACOMPRAONLINE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;TERMO:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; contrato digital que\r\nestabelece as regras de utilização do USUÁRIO na plataforma.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;ACEITAÇÃO:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;AO UTILIZAR O\r\nPRESENTE SITE, VOCÊ USUÁRIO CONCORDA COM TODO OS TERMOS E CONDIÇÕES GERAIS DE\r\nUSO, AINDA QUE NÃO SEJA UM CLIENTE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;No caso de o USUÁRIO não concordar com os termos e condições\r\ndescritos nesse documento, o mesmo não possuí direito de obter informações e não\r\ndeve utilizar este SITE. Lembre-se, ainda, que as disposições contidas nestes\r\nTermos podem ser atualizadas a qualquer tempo e a exclusivo critério da SUACOMPRAONLINE,\r\nsendo de responsabilidade do USUÁRIO verificá-los com frequência.&lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin&quot;&gt;&lt;br&gt;\r\n&lt;br&gt;\r\n&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;A aceitação a este TERMO implicará, ainda, a\r\naceitação à Política de Privacidade do PORTAL, que poderá ser consultada&lt;span class=&quot;apple-converted-space&quot; style=&quot;color: rgb(0, 0, 255);&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(0, 255, 255);&quot;&gt;&lt;span style=&quot;background: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;a href=&quot;http://dev.suacompraonline.com.br/index.php?path=information/information&amp;amp;information_id=3&quot; target=&quot;_blank&quot;&gt;AQUI.&lt;/a&gt;&lt;span style=&quot;background: rgb(255, 255, 255);&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/span&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;SERVIÇOS PRESTADOS:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A Sua Compra Online não comercializa ou transporta produtos,\r\ntendo como seu objetivo apenas aproximar CLIENTES, supermercados PARCEIROS e SHOPPERS.\r\nSua Compra Online é apenas uma plataforma e agente de cobrança sendo isenta de\r\nqualquer responsabilidade na qualidade do produto a ser entregue. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:\r\n107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;CADASTRO:&lt;/span&gt;&lt;/b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Para a correta utilização do SITE, o USUÁRIO, deverá, por\r\nlivre espontânea vontade realizar o cadastro no PORTAL, por meio da internet no\r\npróprio SITE. O Cadastro está condicionado ao fornecimento de dados cadastrais,\r\ninformados em campos específicos como: nome, data de nascimento, endereço, CPF,\r\ne-mail e telefones de contato, a fim de facilitar as compras no PORTAL. O\r\nUSUÁRIO por meio do cadastro manifesta o consentimento livre, expresso e\r\ninformado para a coleta, uso, armazenamento, tratamento e compartilhamento dos\r\ndados, nos termos da POLÍTICA DE PRIVACIDADE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Assim, o USUÁRIO, contrata, ao se cadastrar na plataforma, a\r\nSUACOMPRAONLINE como intermediadora para aproximá-lo a SHOPPERS e supermercados\r\nPARCEIROS.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;LIMITAÇÕES DE\r\nRESPONSABILIDADES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;Para\r\nutilizar o PORTAL e realizar a compra de produtos o USUÁRIO deverá ser\r\ncivilmente capaz, nos moldes da legislação civil vigente no Brasil.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;O\r\nUSUÁRIO se compromete a fornecer ao PORTAL apenas dados e informações\r\nverdadeiras garantindo&lt;span style=&quot;background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt; a autenticidade de toda\r\ninformação e dados fornecidos na utilização do PORTAL, se responsabilizando\r\ncivil e criminalmente por qualquer inexatidão que venha a causar prejuízos ao\r\nPORTAL ou terceiros, se obrigando, ainda, a manter seus dados e informações\r\nconstantemente atualizadas, sempre que houver alterações.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O acesso a áreas restritas dentro do SITE somente é permitida\r\na CLIENTES devidamente cadastrados, utilizando login e senha pessoal, sendo\r\ntais áreas consideradas fechadas. Neste sentido, o USUÁRIO fica ciente que se\r\nalguma falha no sistema for encontrada que permita seu acesso a qualquer área\r\nrestrita do PORTAL, ainda que por mera tentativa e erro de acerto de senha,\r\nincidirá tal USUÁRIO em sanções civis e criminais decorrentes de sua conduta.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O CLIENTE assume neste ato integral responsabilidade pela\r\nguarda e pelo sigilo de seu login e senha de acesso, bem como pelo uso indevido\r\nde seu cadastro por terceiros.&lt;span class=&quot;apple-converted-space&quot;&gt;&amp;nbsp;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;O CLIENTE fica ciente de que, sempre que fundado em indício\r\nde ato ilícito ou descumprimento às regras destes TERMOS, a SUACOMPRAONLINE se\r\nreserva o direito de bloquear o cadastro, suspender temporariamente ou cancelar\r\ndefinitivamente o cadastro do CLIENTE, a qualquer tempo e a seu exclusivo\r\ncritério, sem necessidade de notificação prévia e sem prejuízo de outras\r\nmedidas que entender necessárias e oportunas.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;A\r\nSUACOMPRAONLINE se reserva no direito de não realizar a entrega dos produtos em\r\ncaso de alguma inconsistência no cadastro, sendo opcional a SUACOMPRAONLINE o\r\nestorno financeiro ao CLIENTE.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A SUACOMPRAONLINE é apenas um agente de cobrança, unicamente\r\ncom a finalidade de coletar pagamentos, sem que haja prestação de serviços\r\nrelacionados à venda ou transporte de bens. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Ao aceitar a nomeação de agente de cobrança dos supermercados\r\nPARCEIROS e SHOPPERS, a SUACOMPRAONLINE não assume qualquer responsabilidade\r\npor quaisquer atos ou omissões destes, não se tornando solidária na obrigação\r\ncontratada junto a eles.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Ficam responsáveis os SHOPPERS, pela integridade, validade e\r\nseleção dos produtos, bem como a entrega na quantidade correta e no prazo.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É de responsabilidade do CLIENTE avaliar o SHOPPER\r\ncorretamente, e conferir a compra no recebimento. Dada confirmação de\r\nrecebimento pelo CLIENTE, isenta-se de responsabilidade qualquer outra parte. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;DEVOLUÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Não haverá devolução de valores, após a aceitação do presente\r\nTERMO. Na hipótese de falha do serviço, serão realizadas análises de cada caso.\r\nEm sendo detectada a falha, poderá ser feita a devolução dos valores pagos,\r\ncabendo ao CLIENTE a comprovação da não utilização do serviço/produto.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Nós da Sua Compra Online priorizamos a entrega e fazemos o\r\npossível para que sua compra seja entregue no horário agendado, no entanto,\r\nimprevistos podem ocorrer, podendo gerar leves atrasos, a Sua Compra Online não\r\nse responsabiliza por atrasos de shoppers. Caso o cliente tenha optado por uma\r\ncompra com entrega express e não for atendido em até 2 horas será cobrado o\r\nvalor da entrega comum. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Caso sinta necessidade de reclamar sobre algum produto ou\r\nsobre o serviço, entre em contato conosco via chat ou fale conosco. Produtos\r\nque necessitem de troca devem ser trocados na loja em que foram comprados.&lt;br&gt;\r\n&lt;br&gt;\r\nNo momento do recebimento é necessário que haja uma pessoa de posse do código\r\nde compra enviado via SMS para o celular cadastrado para acusar o recebimento\r\nda compra. Caso no horário agendado para a entrega não haja ninguém habilitado\r\na receber a compra a mesma será devolvida ao supermercado de onde foi comprada\r\ne lá permanecerá para retirada por 3 horas, não sendo retirada em 3 horas a\r\ncompra será devolvida ao supermercado. Em todos os casos acima será cobrado o\r\nvalor da compra e da entrega, e para casos de não recebimento será aplicada\r\nmulta de igual valor ao da entrega. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;VALORES: &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%;mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin&quot;&gt;Os\r\nvalores dos produtos disponíveis na PLATAFORMA são definidos pelo supermercado\r\nPARCEIRO, sem interferência da SUACOMPRAONLINE. Entretanto, poderão ser\r\nacrescidos taxas e encargos nos valores dos produtos, quando comparadas ao\r\nvalor da loja física. Os valores serão cobrados unicamente por meio da\r\nPLATAFORMA, no momento da aquisição dos produtos.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Preços, ofertas e condições exclusivos para internet são\r\nválidos enquanto na plataforma, podendo sofrer alterações sem prévia\r\nnotificação. &lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A SUACOMPRAONLINE não se responsabiliza por eventuais\r\ngorjetas ou gratificações pagas aos SHOPPERS, os quais poderão, mas não\r\ndeverão, ser pagos pelo CLIENTE, a seu critério, sem que haja nenhuma obrigação\r\ngerada pela utilização da PLATAFORMA.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Todo o pagamento sempre será realizado diretamente no SITE,\r\npor meio de cartão de crédito.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;BEBIDAS ALCOÓLICAS:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Proibida a venda de bebidas alcoólicas para menores de idade,\r\nconforme Lei nº8069/90, art. 81, inciso II (Estatuto da Criança e do\r\nAdolescente).&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;OPNIÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;A Sua Compra Online possuí canais abertos para opinião dos\r\nUSUÁRIOS, sendo estas de extrema importância para que possamos continuar a\r\nmelhorar a cada dia nossos serviços. Todavia, autores de comentário ofensivos\r\npoderão ser responsabilizados civil e criminalmente, por conteúdos publicados\r\nque violem a Lei e ou produzam lesões a direitos de terceiros e ou da empresa SUACOMPRAONLINE.\r\n&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É facultativo à SUACOMPRAONLINE a exclusão de comentários,\r\nanúncios, dados e opiniões que sejam caracterizados como contrários a lei, aos\r\nprincípios constitucionais, morais e éticos, bem como os que violem os termos e\r\ncondições.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;margin-left:35.4pt;text-align:justify&quot;&gt;&lt;b&gt;&lt;span style=&quot;font-size: 12pt; line-height: 107%; font-family: Tahoma, sans-serif; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&quot;&gt;MODIFICAÇÕES:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;É direito da SUACOMPRAONLINE realizar modificações no\r\npresente TERMO, visando seu aprimoramento, a melhoria dos serviços prestados ou\r\nrequisições legais que venha a ser necessárias. O novo termo entrará em vigor\r\n10 (dez) dias após sua publicação no site.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;As alterações não vigorarão, porém, em negociações já\r\niniciadas antes de sua publicação, permanecendo nesses casos a redação anterior\r\ncomo vigente. &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%;mso-bidi-font-family:Calibri;\r\nmso-bidi-theme-font:minor-latin&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;b&gt;&lt;span style=&quot;font-size:12.0pt;line-height:\r\n107%;font-family:&amp;quot;Tahoma&amp;quot;,sans-serif&quot;&gt;FORO:&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;text-align:justify&quot;&gt;&lt;span style=&quot;font-size:12.0pt;\r\nline-height:107%&quot;&gt;Fica eleito o foro da Comarca de Curitiba/PR, para dirimir\r\nquaisquer dúvidas e/ou questões relativas ao presente instrumento com renúncia\r\na qualquer outro, por mais privilegiado que seja.&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;span style=&quot;font-size:12.0pt;line-height:107%&quot;&gt;&lt;o:p&gt;&amp;nbsp;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p class=&quot;MsoNormal&quot;&gt;&lt;br&gt;&lt;/p&gt;', 'Termos e Condições de Uso', '', '');
