(7, 'Roasted Beet Hummus ', 'A single roasted beet brings an unexpected va-va-voom to your ordinary hummus. Rich, velvety, earthy, and sweet. And that color. Hello, gorgeous! This is a party-perfect dip – so easy and utterly impressive.', '&lt;div class=&quot;instacart-list-view-mode&quot;&gt;\r\n&lt;div class=&quot;instacart-list-description&quot;&gt;\r\n&lt;p&gt;1. Preheat oven to 400 F.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Wrap beet in foil, place on a sheet tray.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Peel away the outer layers of the garlic bulb skin, leaving the \r\nskins of the individual cloves intact. Cut off about ¼ inch of the top \r\nof cloves, exposing the individual cloves of garlic. Cover with aluminum\r\n foil. Place on same tray as the beets.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Roast the beet and garlic for about 30 minutes. The beet should be\r\n tender. You should be able to easily pierce it with a paring knife. The\r\n garlic cloves should feel soft when pressed.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Let the beet cool until you can handle it. Peel the skin off (I \r\nusually just do this under cool running water). Cut into chunks and \r\nplace in a food processor. Squeeze the roasted garlic cloves out of \r\ntheir skins and into the food processor. Add the garbanzo beans, olive \r\noil, almonds, vinegar, and a generous pinch of salt and pepper. Blend \r\nuntil smooth, scraping down the sides as necessary.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Taste and season as needed with additional salt, pepper, and/or \r\nvinegar. Cover and refrigerate until ready to serve, up to one day. Top \r\nwith ribbons of mint and a healthy lashing of good olive oil.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', 'A Clean Bake', 'data/Recipes/header_4d9f00db-24e5-47d4-89ba-db36793531a9.jpg', 'https://www.youtube.com/watch?v=2LCDRhzDxKg', 0),
