(14, 'Roasted Beet Hummus ', 'A single roasted beet brings an unexpected va-va-voom to your ordinary hummus. Rich, velvety, earthy, and sweet. And that color. Hello, gorgeous! This is a party-perfect dip – so easy and utterly impressive.', '&lt;div class=&quot;instacart-list-view-mode&quot;&gt;\r\n&lt;div class=&quot;instacart-list-description&quot;&gt;\r\n&lt;p&gt;1. Preheat oven to 400 F.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Wrap beet in foil, place on a sheet tray.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Peel away the outer layers of the garlic bulb skin, leaving the \r\nskins of the individual cloves intact. Cut off about ¼ inch of the top \r\nof cloves, exposing the individual cloves of garlic. Cover with aluminum\r\n foil. Place on same tray as the beets.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Roast the beet and garlic for about 30 minutes. The beet should be\r\n tender. You should be able to easily pierce it with a paring knife. The\r\n garlic cloves should feel soft when pressed.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Let the beet cool until you can handle it. Peel the skin off (I \r\nusually just do this under cool running water). Cut into chunks and \r\nplace in a food processor. Squeeze the roasted garlic cloves out of \r\ntheir skins and into the food processor. Add the garbanzo beans, olive \r\noil, almonds, vinegar, and a generous pinch of salt and pepper. Blend \r\nuntil smooth, scraping down the sides as necessary.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Taste and season as needed with additional salt, pepper, and/or \r\nvinegar. Cover and refrigerate until ready to serve, up to one day. Top \r\nwith ribbons of mint and a healthy lashing of good olive oil.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', 'A Clean Bake', 'data/Recipes/header_4d9f00db-24e5-47d4-89ba-db36793531a9.jpg', 'https://www.youtube.com/watch?v=2LCDRhzDxKg', 0),
(15, 'Grain-Free Chocolate Chip Cookies ', 'Thick, soft, and studded with chocolate, just like the &quot;real&quot; thing - only grain-free and gluten-free!', '&lt;div class=&quot;instacart-list-view-mode&quot;&gt;\r\n&lt;div class=&quot;instacart-list-description&quot;&gt;\r\n&lt;p&gt;INGREDIENTS\r\n&lt;br&gt;- 1 3/4 cups finely ground blanched almond flour\r\n&lt;br&gt;- 3 Tablespoons coconut flour \r\n&lt;br&gt;- 2 Tablespoons raw sugar (substitute coconut sugar if Paleo)\r\n&lt;br&gt;- Pinch of salt\r\n&lt;br&gt;- 1/2 teaspoon baking soda (omit if strictly Paleo)\r\n&lt;br&gt;- 1 large egg, lightly beaten\r\n&lt;br&gt;- 1/2 teaspoon vanilla extract\r\n&lt;br&gt;- 3 Tablespoons honey\r\n&lt;br&gt;- 1/4 cup melted coconut oil\r\n&lt;br&gt;- 1/2 cup dark chocolate, roughly chopped\r\n&lt;br&gt;- Fleur de sel (sea salt) for garnish - this is optional&lt;/p&gt;\r\n\r\n&lt;p&gt;DIRECTIONS\r\n&lt;br&gt;Preheat the oven to 350F and cover a cookie sheet with parchment paper or a nonstick pad.&lt;/p&gt;\r\n\r\n&lt;p&gt;Add the flours, sugar, salt and baking soda to a large mixing bowl. Use a fork or whisk and stir gently until combined.&lt;/p&gt;\r\n\r\n&lt;p&gt;In a separate, heat proof bowl, pour the warm melted coconut oil over\r\n the honey. This will soften the honey and make it easier to work with. \r\nStir briefly, then add the oil/honey mixture, egg and vanilla to the dry\r\n ingredients.\r\n&lt;br&gt;Use an electric mixer if possible, or else stir vigorously with a \r\nwhisk or fork, to make sure all of the wet ingredients are distributed \r\nequally throughout the dry ingredients.&lt;/p&gt;\r\n\r\n&lt;p&gt;Stir in chocolate.&lt;/p&gt;\r\n\r\n&lt;p&gt;Scoop heaping Tablespoons of dough and press firmly into a ball. \r\nPress down slightly into a thick disc and repeat with the rest of the \r\ndough.&lt;/p&gt;\r\n\r\n&lt;p&gt;Place 6-8 dough discs on a cookie sheet, leaving at least 2&quot; between each to allow for a bit of spreading.&lt;/p&gt;\r\n\r\n&lt;p&gt;Bake 8-10 minutes, until golden brown around the base. They will still be very soft.&lt;/p&gt;\r\n\r\n&lt;p&gt;Allow to cool for 3-5 minutes on the cookie sheet, where they will \r\nfirm up a bit, before transferring to a rack to cool completely. Be \r\ngentle, as they will still be soft!&lt;/p&gt;\r\n\r\n&lt;p&gt;Serve immediately, or store in an airtight container at room \r\ntemperature for up to a week (if they last that long), or in the freezer\r\n for up to three months.&lt;/p&gt;\r\n\r\n&lt;p&gt;Yield: Makes 15 cookies&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', 'A Clean Bake', 'data/Recipes/header_3971c06c-091b-48a4-aa80-f4d124058bfe.jpeg', 'https://www.youtube.com/watch?v=2LCDRhzDxKg', 0),
(16, 'Roasted Beet Hummus ', 'A single roasted beet brings an unexpected va-va-voom to your ordinary hummus. Rich, velvety, earthy, and sweet. And that color. Hello, gorgeous! This is a party-perfect dip – so easy and utterly impressive.', '&lt;div class=&quot;instacart-list-view-mode&quot;&gt;\r\n&lt;div class=&quot;instacart-list-description&quot;&gt;\r\n&lt;p&gt;1. Preheat oven to 400 F.&lt;/p&gt;\r\n\r\n&lt;p&gt;2. Wrap beet in foil, place on a sheet tray.&lt;/p&gt;\r\n\r\n&lt;p&gt;3. Peel away the outer layers of the garlic bulb skin, leaving the \r\nskins of the individual cloves intact. Cut off about ¼ inch of the top \r\nof cloves, exposing the individual cloves of garlic. Cover with aluminum\r\n foil. Place on same tray as the beets.&lt;/p&gt;\r\n\r\n&lt;p&gt;4. Roast the beet and garlic for about 30 minutes. The beet should be\r\n tender. You should be able to easily pierce it with a paring knife. The\r\n garlic cloves should feel soft when pressed.&lt;/p&gt;\r\n\r\n&lt;p&gt;5. Let the beet cool until you can handle it. Peel the skin off (I \r\nusually just do this under cool running water). Cut into chunks and \r\nplace in a food processor. Squeeze the roasted garlic cloves out of \r\ntheir skins and into the food processor. Add the garbanzo beans, olive \r\noil, almonds, vinegar, and a generous pinch of salt and pepper. Blend \r\nuntil smooth, scraping down the sides as necessary.&lt;/p&gt;\r\n\r\n&lt;p&gt;6. Taste and season as needed with additional salt, pepper, and/or \r\nvinegar. Cover and refrigerate until ready to serve, up to one day. Top \r\nwith ribbons of mint and a healthy lashing of good olive oil.&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;/div&gt;', 'A Clean Bake', 'data/Recipes/header_4d9f00db-24e5-47d4-89ba-db36793531a9.jpg', 'https://www.youtube.com/watch?v=2LCDRhzDxKg', 0),
(17, 'Healthier Pistachio Orange Rice Pudding', 'safasfasdfas', '&lt;p&gt;Combine the rice, milk, honey, cinnamon, vanilla and orange blossom \r\nwater in a small saucepan. The milk should cover the rice completely. \r\nStir to combine.&lt;/p&gt;\r\n\r\n&lt;p&gt;Bring mixture to a boil, then reduce the heat to medium and simmer, \r\nstirring constantly, until the liquid has been absorbed enough so that \r\nthe grains of rice have opened and the liquid is below the level of the \r\nrice. &lt;/p&gt;\r\n\r\n&lt;p&gt;Turn off the heat, and add tapioca starch. Stir for 60-90 second until the pudding thickens. Then stir in the pistachios. &lt;/p&gt;\r\n\r\n&lt;p&gt;Let cool slightly, then garnish with additional cinnamon and pistachios before serving.&lt;/p&gt;\r\n\r\n&lt;p&gt;Store leftovers in an airtight container in the fridge for up to a week; reheat before serving. &lt;/p&gt;\r\n\r\n&lt;p&gt;Notes:\r\n&lt;br&gt;(1) If using unsweetened almond milk, add an additional 1/2 Tablespoon honey, or to taste\r\n&lt;br&gt;(2) If using unsalted pistachios, add a pinch of salt\r\n&lt;br&gt;(3) Most people are used to raisins in rice pudding. I did not add \r\nthem because the brown rice is much chewier than white would be. If you \r\nwant them though, add about 2 Tablespoons golden or brown raisins.&lt;/p&gt;', 'asdsad', 'data/Recipes/header_3c85f00f-7140-4c4e-8a87-926ef759bdf4.jpg', 'https://www.youtube.com/watch?v=2LCDRhzDxKg', 0),
